//import { puppyData } from '../puppyData';

export const getPuppies = async (setPuppies) => {
    try {
      const response = await fetch('https://fsa-puppy-bowl.herokuapp.com/api/2211-FTB-ET-WEB-FT/players');

      const data = await response.json();
      // console.log(data);
      setPuppies(data);
    } catch (error) {
      console.error(error);
    }
  };
